import React from "react";

const Resources = () => {
  return (
    <ul>
      <li>https://www.wwf.org.uk/</li>
      <li>https://www.globalwildlife.org/</li>
      <li>
        https://www.nationalgeographic.org/encyclopedia/wildlife-conservation/
      </li>
      <li>https://www.nature.org/en-us/</li>
      <li>https://www.nrdc.org/</li>
      <li>https://www.sierraclub.org/</li>
      <li>https://www.conservation.org/home</li>
      <li>https://www.audubon.org/</li>
      <li>https://www.janegoodall.org/</li>
    </ul>
  );
};

export default Resources;
